import React from 'react'
import useStyles from '../Offers/Offers-jss';

const classes = useStyles();


const ms = () => {
    return (
        <div className={`${classes.root} text-center`}>
            <h3 > Medical services </h3>
            <p> Help patients in their chirurgical operations or medical treatment </p>
            <span> list of available offers in this category :</span>
            <ul>
                <li> one item </li>
                <li> second item </li>
                <li> third item </li>
                <li> forth item </li>
            </ul>
        </div>
    )
}

export default ms ;
